import Todo from "../todo/Todo";

function List() {
  const array = [
    { name: "나", age: 16, done: false },
    { name: "다", age: 4, done: false },
    { name: "마", age: 5, done: false },
    { name: "라", age: 16, done: false },
    { name: "뇨", age: 3, done: false },
  ];

  const name = array.map((item) => {
    if (item.age > 10) return { ...item, done: true };
  });

  console.log(name);

  return (
    <div>
      List
      <Todo />
    </div>
  );
}

export default List;
